import UsersList from "./components/UsersList";
import SecondList from "./components/SecondList";
import FinalList from "./components/FinalList";

const Landing: React.FC<any> = () => {

  return (
    <Fragment>
        <UsersList />
        <SecondList />
        <FinalList />
    </Fragment>
  );
};

export default Landing;
